import React, { Component } from 'react';
import './sot.css';
 class TermsAndServices extends Component {
  render() {
    return (
      <React.Fragment>
  <div id="fb-root"></div>
  <div class="tl_page_wrap">
    <div class="container clearfix tl_page_container ">
      <div class="tl_page">
        <div id="dev_page_content_wrap" class=" ">
<div class="dev_page_bread_crumbs"></div>
<h1 id="dev_page_title" dir="auto">Terms of Service</h1>

<div id="dev_page_content" dir="auto"><p>By signing up for Telegram, you accept our <a href="/privacy">Privacy Policy</a> and agree not to:</p>
<ul>
<li>Use our service to send spam or scam users.</li>
<li>Promote violence on publically viewable Telegram channels, bots, etc.</li>
<li>Post illegal pornographic content on publically viewable Telegram channels, bots, etc.</li>
</ul>
<p>We reserve the right to update these Terms of Service later.</p>
<blockquote>
<p>Citizens of EU countries and the United Kingdom must be at least 16 years old to sign up.</p>
</blockquote>
</div>

</div>
        
      </div>
    </div>
  </div>
  
      </React.Fragment>
    );
  }
}


export default TermsAndServices;
